                                                                                                                                                                 (5001, 5001, '2021-01-15 06:52:30', NULL, '2021-01-15 06:53:44', 1, 'en', 'BAKIMLI DİZEL OTOMATİK DEĞİŞENSİZ RESİMDEKİ HALİ GİBİ TERTEMİZ', '<p></p><p><b><i><u>ARACIM 2013 MODEL 1.6 DİZEL OTOMATİK&nbsp;</u></i></b></p>\r\n<p><b><i><u>SORUNSUZ BAKIMLI BİR ARAÇTIR COMFORTLİNE&nbsp;</u></i></b></p>\r\n<p><b><i><u>YAKIT ZATEN BİLİNDİĞİ GİBİ&nbsp;</u></i></b></p>\r\n<p><b><i><u>YÜRÜR ŞANZIMAN &nbsp;ÇOK ŞÜKÜR SORUNSUZ&nbsp;</u></i></b></p>\r\n<p><b><i><u>KAVRAMA BAKIMI VS HEPSİ YAPILDI&nbsp;</u></i></b></p>\r\n<p><b><i><u>KİLOMETRE TEYİT RESMÎ EN SONDA ORJİNALDİR&nbsp;</u></i></b></p>\r\n<p><i><u><b>EKSPERTİZ BİLGİSİ</b></u></i></p>\r\n<p><b><i><u>ARACIM DA BÜYÜK BİR KAZA BELA DARBE&nbsp;</u></i></b></p>\r\n<p><b><i><u>YOKTUR&nbsp;</u></i></b></p>\r\n<p><b><i><u>DEĞİŞEN YOKTUR&nbsp;</u></i></b></p>\r\n<p><b><i><u>BOYA FARKLI ZAMANLARDA SÜRTMELER DEN DOLAYI SAĞ TARAFTA VAR İÇLERİNDE&nbsp;</u></i></b></p>\r\n<p><b><i><u>DİREKLERİNDE &nbsp;BİRŞEY YOK TERTEMİZ&nbsp;</u></i></b></p>\r\n<p><b><i><u>HARİCİ KAPUT DA UFAK BİR BOYA VAR&nbsp;</u></i></b></p>\r\n<p><b><i><u>&nbsp;GERİ KALAN BÜTÜN PARÇALAR&nbsp;</u></i></b></p>\r\n<p><b><i><u>ŞASELER DİREKLER &nbsp;ÖNEMLİ HERYER HATASIZ&nbsp;</u></i></b></p>\r\n<p><b><i><u>HASAR OLARAK &nbsp;PARÇA PARÇA 9.000₺(dokuzbintl)</u></i></b></p>\r\n<p><b><i><u>BAZI ÖZELLİKLERİ&nbsp;</u></i></b></p>\r\n<p><b><i><u>ABS&nbsp;</u></i></b></p>\r\n<p><b></b>\r\n</p>\r\n<p><b><i><u>SÜRÜCÜ-YOLCU-YAN HAVA YASTIĞI</u></i></b>\r\n</p>\r\n<p><b><i><u>LASTİK ARIZA GÖSTERGESİ</u></i></b>\r\n</p>\r\n<p><b><i><u>MERKEZİ KİLİT</u></i></b>\r\n</p>\r\n<p><b><i><u>ÇOCUK KİLİDİ</u></i></b>\r\n</p>\r\n<p><b><i><u>İMMOBİLİZER</u></i></b>\r\n</p>\r\n<p><b><i><u>ÖN KOL DAYAMA</u></i></b>\r\n</p>\r\n<p><b><i><u>ELEKTRİKLİ ÖN & ARKA CAMLAR</u></i></b>\r\n</p>\r\n<p><b><i><u>ELEKTRİKLİ ve ISITMALI YAN AYNALAR</u