                                                                                                                                                                 (5003, 5003, '2021-01-15 06:55:56', NULL, '2021-01-15 06:56:32', 1, 'en', 'MACBOOK PRO RETINA 2019 TOUCBAR ', '<p></p><p>MACBOOK PRO RETİNA TOUCHBARLI MODELİ TEMİZ VE SORUNSUZ ÇALIŞMAKTADIR. KOZMETİK OLARAK HATASIZ PİL DURUMU ÇOK İYİ PİL DEVİR SAYISI SADECE 155 DE OLUP GÜNLÜK KULLANIMDA 5-6 SAAT ŞARJI GİTMEKTEDİR. YÜKSEK ÖZELLİKLERDEKİ 1.4 GHZ İŞLEMCİLİ 8 GB RAM Lİ MACBOOK PRO RETİNA TOUCHBARLI MODELİ BU FİYATA KAÇMAZ BİR FIRSAT ÜRÜNÜ..! KUTUSU VE TÜM AKSESUARLARI MEVCUTTUR..! CİHAZ AMERİKADAN ALINMIŞTIR VE 1 SENELİK ULUSLARARASI GARANTISI YENİ DOLMUŞTUR. 150 TL DEĞERİNDE SİLİKON KORUYUCU KILIF HEDİYEDİR.</p><p></p>'),
                                                                                                                                                                 (5004, 5004, '2021-01-15 06:57:33', NULL, '2021-01-15 06:58:24', 1, 'en', 'DENİZLİ\'DE ASFALTA CEPHE 8.777M2 BAĞ ve BAĞ EVİ !', '<p></p><ul><li>Denizli / Bekilli / Yeni Mh\'de\r\n</li><li>255 Ada 15 Parsel\r\n</li><li>8.777 m2 Çekirdeksiz Bakımlı Üzüm Bağı\r\n</li><li>Asfalta Cephedir.&nbsp; (Çal-Bekilli Asfaltıdır)\r\n</li><li>Şebeke Suyu Tarafımızca Çekilmiştir. Mevcuttur.\r\n</li><li>Güneş Paneli İle Ücretsiz Elektrik Üretimi Mevcuttur.\r\n</li><li>2+1 - 70 m2 Ev Mevcuttur\r\n</li><li>İmar Affından Faydalanılmış Olup , Yapı Kayıt Belgesi Mevcuttur.\r\n</li><li>Taş Fırını Mevcuttur\r\n</li><li>Yanında , Arkasında Ve Etrafında Komşu Bağ Evleri Mevcuttur\r\n</li><li>Bekilli İlçe Merkezine Sadece 2Km\'dir\r\n</li><li>Araba İle Takas Olabilir.\r\n</li></ul>'),
(5005, 5005, '2021-01-15 06:59:34', NULL, '2021-01-15 07:26:52', 1, 'en', 'ORJİNAL ADİDAS SWİFT RUN', '<p>Piyasa değeri 650 tldir. Resimlerde görüldüğü gibi sıfırdan farksız</p>'),
(5006, 5006, '2021-01-15 07:27:43', NULL, '2021-01-15 07:30:10', 1, 'en', 'CENNETTEN BİR KÖŞE,MUHTEŞEM DENİZ MANZARALI DAİRE', '<p>MUHTEŞEM MANZARA EŞLİĞİNDE DAİRENİZDE KAHVENİZİ YUDUMLAYIP GÜNÜN STRESİNDEN UZAKLAŞIN. CAFELER MARKETLER VE DENİZ YÜRÜME MESAFESİNDEDİR.MİNİBÜS VE OTOBÜS DURAĞI BİNANIN ÖNÜNDEDİR.METROBÜS 3KM UZAKLIKTADIR. DAİREMİZ YERDEN ISITMADIR.ELEKTRİK VE SU KESİNTİSİ ASLA YAŞANMAZ.(JENERATÖR VE YEDEK SU DEPOSU MEVCUTTUR).</p>'),
(5007, 5007, '2021-01-15 07:31:06', NULL, '2021-01-15 07:32:48', 1, 'en', 'EŞYALI 3+1 KİRALIK DAİRE', '<p>Salon Takımı <br>Masa Sandalye <br>TV <br>Oturma Odası Takimi <br>Tüm odaların Halısı <br>Tek kişilik 4 adet Baza Yatak<br>Çamaşır Makinesi <br>Perdeler <br>Vestiyer <br>Elbise Dolabi <br>2 adet Utu Masası <br>Buzdolabı <br>Duşa <u>Kabin</u><br> Fırın Mevcuttur. Detaylar için arayınız.</p><p></p>'),
(5008, 5008, '2021-01-15 07:33:37', NULL, '2021-01-15 07:34:13', 1, 'en', '2016 golf 1.6 tdı bluemotion comfortline', '<p>Arac titizlikle kullanılmıştır. Ön kaput ucunda 1 karış lokal boya var harici hata boya yok nakit ihtiyacından satılıktır pazarlık az da olsa vardır cam tavan yok</p>'),
(5009, 5009, '2021-01-15 07:35:09', NULL, '2021-01-15 07:36:09', 1, 'en', 'Xeon işlemcili hızlı bilgisayar', '<p>Xeon işlemcili hızlı bilgisayar.\r\n</p><p>Kasa 380 watt\r\n</p>\r\n<p>Anakart Pegatron IPMG41-D3\r\n</p>\r\n<p>İşlemci Xeon E5440 2.83 mhz 12 mb önbellek\r\n</p>\r\n<p>Ram 2x2 gb Toplam 4 GB Kingston ram\r\n</p>\r\n<p>Optik sürücü Dvd Rw\r\n</p>\r\n<p>Harddisk 160 Gb Windows\r\n</p>\r\n<p>Harddisk 500 gb Yedek\r\n</p>\r\n<p>Ekran kartı 4 gb 128 bit\r\n</p>\r\n<p>Kablosuz klavye mouse hediye.\r\n</p>\r\n<p>Windows 10 yüklü olarak verilecektir. Fiyat olarak uygundur. \r\n</p>'),
(50010, 50010, '2021-01-15 07:37:02', NULL, '2021-01-15 07:38:33', 1, 'en', 'htc desir 820', '<p>ön tarafindaki kırık ekranda degil ekran korucudadir ekrani temiz ve sağlamdır. 16 gb hafiza 2 gb ram 5.5 inc ekran boyutu 1280*720 ekran çözünürlüğü Bluetooth wi-fi GPS NFC ve 4.5 g baglanti vardir. citf ön streo hoparlör vardir</p>'),
(50011, 50011, '2021-01-15 07:38:39', NULL, '2021-01-15 07:39:25', 1, 'en', 'SIVAS MERKEZ ISTASYON CADDESI SIVAS LISESI KAVŞAĞINDA KIRALIK EV', '<p>merkezi konumda çarşının ortasında kiralık daire  </p>\r\n<p>sivas lisesi kavşağında ev doğalgazlı mantolama li ici yeni yapıldı laminat mutfak dolabı vestiyer  boya v.b.\r\n \r\n</p>'),
(50012, 50012, '2021-01-15 07:39:59', NULL, '2021-01-15 07:42:21', 1, 'en', 'ACİL PAZARLIKSIZ SON FİYAT !!!ORJİNAL TEMİZ ARAÇ EXCLUSİVE PAKET', '<p></p><p>Kaçırılmıycak fırsat aracı kaçıran üzülür.\r\n </p>\r\n<p><u>Aracımı sporline olan modellerle karıştırmayın.</u>\r\n </p>\r\n<p><u>Exclusive yazıp sporline araç satan çok var aradaki farklılıkları göz önüne alalım</u>.\r\n </p>\r\n<p>Aracımı model yükseltmek için satıyorum.\r\n </p>\r\n<p>Aracın sağ tarafından farklı bir aracın geri gelirken çarpması  sonucunda sağ çamurlukta lokal boya ve düzeltme işlemi vardır resimleri  mevcuttur. İsteyen ciddi alıcılara ŞEFFAF bir şekilde bütün hepsi  gönderilir.\r\n </p>\r\n<p>Şehir dışından almak ısteyen arkadaşlarada detaylı bir şekilde aracın videosu ve resimleri gönderilir.\r\n </p>\r\n<p>Benden önceki sahibi ön arka tamponlara temizlik boyası  yaptırmıştır.Araç sıfır araç değildir 8 yıllık araçtır ve doğal olarak  muhtelif bazı yerlerde ufak tefek çizikleri vardır. Bilen bilir bu  araçların sunroof perdeleri sorunludur ben alırken aracımda yoktu ve  sorunlu oldugunu bildiğim içinde boş yere para verip taktırmadım.  Önceden satın alan kişinin ve benim eksper raporları ben satın alırken  vw yetkılı servısten araç geçmişi motor geçmişi hakkında olan belgeler  hepsi mevcuttur ve bu belgelerin hepsinide almak isteyen kişiye  gönderebilirim.İnceler bütün evrakları ondan sonra gönül rahatlığıyla  aracımı satın alıp kullanabılır. Satın alacak kişi hiç bir masraf  etmeden alıp kullanacaktır. Araç güncel olarak kullanıldığı için  kilometrede farklılık gösterebilir.\r\n </p>\r\n<p>ARAC MUAYNESİ YENİ YAPILDI.\r\n </p>\r\n<p>RENK ÖZEL LANSMAN RENGİDİR.\r\n </p>\r\n<p>ARACIMIN İÇ DIŞ KOMPLE DETAYLI TEMIZLIGI PASTA CİLASI BOYA KORUMA İŞLEMLERİ YENİ YAPILMIŞTIR.\r\n </p>\r\n<p>ARACIN BÜTÜN BAKIMLARIDA YAPILMIŞTIR.\r\n</p>'),
(50013, 50013, '2021-01-15 07:43:08', NULL, '2021-01-15 07:44:07', 1, 'en', 'İRMİŞ APARTMANINDA 2 YILLIK 2+1 Geniş daire', '<p>Sıfır aldığımız 1.elden 2+1 dairemiz satılıktır.\r\nTermosifon -ayakkabılık dolabı -yorgan dolabı sökülmeyecektir.\r\nÇarşıya  yürüyerek 3 dk mesafededir, kapalı ve açık otopark mevcuttur,otopark  bina sahiblerine fazlasıyla yetmektedir, çevre düzenlemesi halen  bitmemiştir, bittiği takdirde 3 blok şeklinde site içi  olacaktır.Çocuklar için güvenli bir bahçesi vardır.\r\nHastahane yürüme mesafesidir\r\n</p>\r\n<p>Merkezi  sistem kalorifer sistemi vardır, bina izolasyonlu olduğundan dolayı  ısınma ücreti düşüktür ve fazlası ile sıcak olmaktadır.\r\n</p>\r\n<p>Bina 7/24 kamera sistemi ile güvenlik altındadır.\r\n</p>'),
(50014, 50014, '2021-01-15 07:44:56', NULL, '2021-01-15 07:46:13', 1, 'en', '2011 model temiz bakımlı 600rr', '<p>yağ vs bakımı yeni yapıldı,\r\n mekanik hiç bir sorunu yoktur. istediğiniz yere gösterebilirsiniz.\r\n </p>\r\n<p>parça parça hasar kaydı var\r\n alıcısına şimdiden hayırlı olsun\r\n \r\n</p>'),
(50015, 50015, '2021-01-15 07:47:01', NULL, '2021-01-15 07:49:40', 1, 'en', 'ÖN CEPHEDE SAHİBİNDEN SATILIK SON DAİRE', '<p>*Sahibinden,\r\n</p>\r\n<p>*Ön cephede,\r\n</p>\r\n<p>*Doğalgaz bina önüne kadar gelmiştir.\r\n<br></p>\r\n<p>*Her katta 3 daire bulunmakta ,3+1 olmak üzere&nbsp;&nbsp;oturma ruhsatı alınmış ve satışa hazırdır.\r\n</p>\r\n<p>*Apartman da bulunan 12 dairenin 11 inde oturan mevcut olup, kalan son boş dairedir.\r\n</p>\r\n<p>&nbsp;*Termodinamik marka Merkezi Kömür ısıtmalı\r\n</p>\r\n<p>*Bahçe,otopark,\r\n</p>\r\n<p>*Asansörlü,\r\n</p>\r\n<p>*Görüntülü Diafon sistemi,\r\n</p>\r\n<p>*Merkezi uydu Sistemi,\r\n</p>\r\n<p>*Spot Aydınlatma,\r\n</p>\r\n<p>*Mutfak ankastre ürünleri&nbsp;Davlumbaz,Setüstü Ocak,Ankastre Fırın mevcut olup SİEMENS markadır,\r\n</p>\r\n<p>&nbsp;*Bataryalar ankastre olup Grohe ve E.C.A markalıdır,\r\n</p>'),
