(50021, 50021, '2021-01-15 08:13:12', NULL, '2021-01-15 08:15:07', 1, 'en', 'Öğretmenden Yetkili Servis Bakımlı 2015 model (otomatik)', '<p>✅Bütün bakımları zamanında yapılmış olup 120 bin km’deki ağır bakımı yapılmıştır.<br> ✅Yaz ve kış olmak üzere boya koruması,pasta,cila,motor temizliği ve detaylı iç ve dış bakımı düzenli olarak yapılmış olup faturalarını alıcıya verebilirim. <br>✅Ben üç sene evvel alırken de kaputu boyalıydı bende trafik kazası fotoğrafı mevcuttur.Önemsiz hafif bir kaza sonucu boyanmış. <br>✅ Trafiğe çıkış tarihi (19.06.2015)’tir. <br>✅Her türlü Expertiz’e açıktır. <br>✅113.979 km’si an itibariyle budur. <br>✅Yedek anahtarı, kitapçığı, servis bakım faturaları ve yedek lastiği mevcuttur. <br>✅Bütün bakımları Yetkili Servis Mez ve Altur’da yapılmıştır. <br>✅Kaza sonraları da oraya götürülmüştür. Toplam üç kazası mevcuttur. Fotoğrafları arşivimdedir. Ciddi ağır kazası yoktur. Hep rotuşlar yapılmıştır. Malum yetkili servisler fiyatları yüksek oluyor. Bundan dolayı tramer kaydı toplamda 6.123 tl’dir. <br>✅Lütfen ciddi alıcılar mesaj yazsın ya da arasın teşekkür ederim.</p>'),
