(50026, 50026, '2021-01-15 08:24:41', NULL, '2021-01-15 08:27:14', 1, 'en', 'YAVRU MUHABBET KUŞLARI', '<p>Bursa Nilüfer ata evlerde kendi üretimhanemiz de ürettiğimiz alıştırmaya ve konuşturmaya çok müsait bebek yavrular sahiplendirilir. İlandaki resimler haricinde her gün yeni yeme düşmüş bebek kuşlarımız oluyor lütfen üretimhanemizi ziyaret edip bilgi alabilirsiniz. Düz sarı beyaz parçalı değişik renk güzeli kuşlarımız vardır.</p>'),
