(50029, 50029, '2021-01-15 08:33:15', NULL, '2021-01-15 08:34:14', 1, 'en', 'Sahibinden KAZASIZ DEGİSENSİZ CİVİC', '<p>Sadece sol ön çamurluk boyalıdır harici KAZA-BOYA-DEĞİŞEN yoktur.(tramer sadece 465₺)</p>\r\n<p>Fabrika çıkışı BRC LPG mevcuttur.</p>\r\n<p>Donanım olarak lütfen Elagance modellerle karistirmayiniz aracım en full donanım olan excutive modelidir.</p>\r\n<p>*KEYLESS GO (ANAHTARSIZ AÇIP KAPAMA)</p>\r\n<p>*BEJ DERİ KOLTUK</p>\r\n<p>*START STOP</p>\r\n<p>*DOUBLE EKRAN <br>*XENON FAR <br>*KOLTUK İSİTMA <br>*ECO MOD <br>*GERİ GÖRÜŞ KAMERASI <br>*SUNROOF</p>\r\n<p>*ÖN VE ARKA KOL DAYAMA <br>*KROM KAPI ÇİTALARI <br>*F1 VİTES <br>*HIZA DUYARLI DİREKSİYON <br>*HIZ SABİTLEME <br>aklıma gelmeyen bir çok özelliği daha mevcuttur.</p>\r\n<p>Aracı istediğiniz ustaya,servise veya expertize gösterebilirsiniz.</p>\r\n<p>Fiyatı abartmadan gerçek piyasa değerinde yazdım ufak bir pazarlık payım vardır o da araç başında olur.</p>\r\n<p>Plakayı isteyene verebilirim</p>\r\n<p>İyi günler herkese.</p>'),
(50030, 50030, '2021-01-15 08:35:31', NULL, '2021-01-15 08:36:16', 1, 'en', 'General Mobile GM 20 Single Akıllı Telefon, 64 GB, Parlak Siyah', '<p>Üreticiden Ergonomik Tasarım ￼ General Mobile GM 20, 6.088” boyutuyla elinize rahatça sığarak kullanım kolaylığı sağlıyor. Performans ￼ HELIO A25, OCTA-CORE 1.8 GHZ İŞLEMCİ Gece Modu ile Geceyi Aydınlat ￼ Vizyonunuzu Genişletin ￼ 52 MP Süper Pixel, 6240x 8320 çözünürlükte çekim yapmanızı sağlıyor. 8 MP Selfie Kamera ￼ Portre modlu selfie kamera ile hep ön planda olun. Açıklama Ürün Açıklaması 4 GB RAM & 64 GB Hafıza, Mediatek MT6762D Helio A25, Android 10, Type-C, 13MP+2MP+2MP Triple Arka Kamera, 8 MP Ön Kamera, 4000 Mah Batarya. Setin İçeriği: GM20, Şarj Kablosu, Şarj Adaptörü, Kulaklık, Silikon Kılıf Özellikler ve ayrıntılar 4 GB Ram, 64 GB Depolama 13MP+2MP+2MP Triple Arka Kamera, 8MP Selfie Kamera Mediatek MT6762D Helio A25, Android 10 4000 mAh Batarya Type-C</p>'),
