(50035, 50035, '2021-01-15 08:43:51', NULL, '2021-01-15 08:44:46', 1, 'en', '4.000 TL KİRA GETİRİLİ FULL EŞYALI İLK GELEN ALIR', '<p>EVİMİZ  FULL EŞYALIDIR.PROJENİN MERKEZİNDE D BLOKTADIR.HER YERE YÜRÜME  MESAFESİNDEDİR.DETAYLAR TELEFONDA VERİLECEKTİR.İÇİNİN RESİMLERİ WHATSAPP  ÜZERİNDEN VERİLECEKTİR.70 METREKAREYE YAKIN ÖN BAHÇESİ DE  MEVCUTTUR.LÜTFEN CİDDİ ALICALAR ULAŞSIN SAYGILAR İYİ GÜNLER.\r\n</p>'),
(50036, 50036, '2021-01-15 08:45:30', NULL, '2021-01-15 08:47:23', 1, 'en', 'Android TV BOX 3/32GB S912 Chipset KUTUSUNDA', '<p>Standart olarak Android 6.0.1 yüklüdür. Antutu puanı kendi kategorisinde oldukça yüksektir.</p>\r\n<p>Chigz Tech youtube kanalında Android TV Box sıralamasında 2017\'de ilk 4\'te, 2018 yılında ise 6. sırada yerini korumuştur.</p>\r\n<p>Güncel Android TV BOXlar arasında S912 chipseti ile aranan bir BOX\'tır.</p>\r\n<p>Android 7.1.2\'ye veya atvXperience yükseltme ROM\'ları yüklenebilir.</p>\r\n<p>(Android 6.0.1, 7.1.2 ve uyumlu atvXperience ROM\'ları ve gerekli programlar CD olarak ayrıca verilecektir.)<br></p><p>Piyasadaki bir çok kaliteli Mouse/Klavye/GamePad ile uyumludur.\r\nHiçbir hatası, sorunu, problemi YOKTUR.\r\nÖzenli bir şekilde kullanılmış olup, SIFIR AYARINDADIR !\r\nKUTU içeriği eksiksizdir.</p>'),
(50037, 50037, '2021-01-15 08:48:15', NULL, '2021-01-15 08:49:28', 1, 'en', 'LENOVO S145-15IKB İ5-8250U 8GB 512GB 2GB MX110 FHD', '<p><b>* INTEL CORE(TM) i5-825</b><b>0U 1.60GHZ UP 3.40GHZ</b>\r\n</p>\r\n<p><b>* 8 GB DDR4 2400MHZ RAM</b>\r\n</p>\r\n<p><b>* 512GB NVME M.2 YÜKSEK HIZLI SSD</b>\r\n</p>\r\n<p><b>* 2 GB NVIDIA GEFORCE MX110 HARICI EKRAN KARTI</b>\r\n</p>\r\n<p><b>* INTEL HD GRAPHICS 620 CIFT EKRAN KARTI</b>\r\n</p>\r\n<p><b>* 15.6\" FULLHD LED MAT EKRAN(1920x1080p)</b>\r\n</p>\r\n<p><b>* 2 SAAT PİL ÖMRÜ</b>\r\n</p>\r\n<p><b>* TYPE-C , USB 3.1 , HDMI , HD WEBCAM , BLUETOOTH</b>\r\n</p>\r\n<p><b>* KART OKUYUCU</b>\r\n</p>\r\n<p><b>* KOZMETİK 10/9.5</b></p>\r\n<p><b>* INCE ŞIK VE HAFİF TASARIM</b>\r\n</p>\r\n<p><b>* DOLBY AUDİO GÜÇLÜ SES SISTEMI</b>\r\n</p>\r\n<p><b>* WINDOWS 10 64BİT VE OFFİCE PROGRAMLARI</b>\r\n</p>\r\n<p><b>* ORJINAL ADAPTÖR</b>\r\n</p>\r\n<p><b>* ÜRÜN KUTULU VATAN FATURALIDIR 13 AY GARANTİLİ</b>\r\n</p>\r\n<p><b>* LAPTOP ÇANTASI VE KABLOSUZ MOUSE HEDİYEMİZDİR.</b>\r\n</p>\r\n<p><b>* SSD SAYESİNDE&nbsp;</b><b>HIZLI BİR CİHAZDIR VE EKRAN KARTI GÜÇLÜDÜR. OYUN VE PERFORMANS CİHAZI.</b>\r\n<br></p>\r\n'),
(50038, 50038, '2021-01-15 08:50:10', NULL, '2021-01-15 08:51:09', 1, 'en', '1333MHZ DDR3 SOKET 1155PİN mATX ANAKART ', '<p></p><table><tbody><tr><td><strong><b>Soket Tipi</b></strong>\r\n</td><td><b>LGA 1155 Pin</b>\r\n</td></tr><tr><td><strong><b>Ram Tipi</b></strong>\r\n</td><td><strong><b>DDR3</b></strong>\r\n</td></tr><tr><td><b>Chipset</b>\r\n</td><td><b>H61</b>\r\n</td></tr><tr><td><b>Anakart Yapısı</b>\r\n</td><td><b>mATX</b>\r\n</td></tr><tr><td><b>Ram Slot Sayısı</b>\r\n</td><td><strong><b>2</b></strong>\r\n</td></tr><tr><td><strong><b>Desteklenen Ram Hızı</b></strong>\r\n</td><td><strong><b>800/1066/1333 MHz</b></strong>\r\n</td></tr><tr><td><strong><b>PCI Express 3.0x16</b></strong>\r\n</td><td><b>1</b>\r\n</td></tr><tr><td><strong><b>PCI Express x1</b></strong>\r\n</td><td><strong><b>2</b></strong>\r\n</td></tr><tr><td><b>USB</b>\r\n</td><td><strong><b>2xUSB 3.0 4xUSB 2.0</b></strong>\r\n</td></tr><tr><td><b>Ethernet</b>\r\n</td><td><strong><b>100M/1000M</b></strong>\r\n</td></tr><tr><td><strong><b>HDMI</b></strong>\r\n</td><td><b>Var</b>\r\n</td></tr><tr><td><b>DVI&nbsp;</b>\r\n</td><td><strong><b>Yok</b></strong>\r\n</td></tr><tr><td><strong><b>VGA</b></strong>\r\n</td><td><strong><b>Var</b></strong>\r\n</td></tr></tbody></table>'),
(50039, 50039, '2021-01-15 08:52:03', NULL, '2021-01-15 08:53:46', 1, 'en', 'BODRUMDA SATILIK TAM MÜSTAKİL DEĞERİNİN ÇOK ALTINDA', '<p>Değerinin çok altında acil ihtiyaçtan satılık Bodrumun en nezih  sitelerinden Adabükü Flamingo Sitesinde 3+1 3 banyolu Sitenin en büyük  bahçeli ve özel havuzlu tripleks full yeni eşyalı oturmaya hazır evcil  hayvan dostu sitemizin en güzel Ayrıca önü açık asla kapanmayacak ferah  en güzel villasıdır.\r\n</p>\r\n<p>NOT.Özellikle muhafazakar aileler için uygun etrafı duvar &nbsp;bitkiler bengonviller ile kaplı tam müstakil villadır.Takas kesinlikle düşünülmemektedir.</p>\r\n<p>Site sakinleri çoğunlukla AB vatandaşı yabancılardan oluşmaktadır.</p>\r\n<p>VİLLANIN ÖZELLİKLERİ</p>\r\n<p>Mimari özellikleri ve manzara olarak sitenin en güzel ve en büyük bahçeli Villasıdır.Tüm peyzaj,otomatik sulama,otomatik ışıklandırması yapılmış masrafsız oturmaya hazırdır.</p>\r\n<p>SİTENİN ÖZELLİKLERİ <br>Siteye özel iskele Plaj Beach Club</p>\r\n<p>18 adet açık havuz 1 adet kapalı ısıtmalı havuz</p>\r\n<p>Cafe Bar,açıl ve kapalı alan ala-carte restaurantlar</p>\r\n<p>Golf sahası</p>\r\n<p>Tenis,Voleybol,Basketbol sahaları</p>\r\n<p>Bilardo salonu</p>\r\n<p>Fitness ve Spor salonu</p>\r\n<p>Sauna <br>Türk hamamı</p>\r\n<p>Güzellik merkezi</p>\r\n<p>Masaj</p>\r\n<p>Market,Çamaşırhane</p>\r\n<p>7/24 Güvenlik</p>\r\n<p>Peyzaj Bahçe Bakım işleri</p>\r\n<p>Siteye özel plaj migros ve pazar yeri saat başı dolaşan ücretsiz shuttle servisi</p>\r\n<p>Özel kameralı 7/24 güvenlik sistemi</p>\r\n<p>Açık oto park</p>\r\n<p>Bodrum hava limanına 15 dakika</p>\r\n<p>Bodrum merkeze Torba,Bitez Yalıkavaka 25-30dakika</p>\r\n<p>Güvercinlik merkeze 15 dakika</p>\r\n<p>Milas merkeze 20 dakika</p>\r\n<p>Resimlerde görüldüğü gibi Sitenin en büyük bahçeli bakımlı müstakil havuzlu göl ve orman manzaralı en güzel villasıdır.</p>\r\n'),
(50040, 50040, '2021-01-15 08:54:25', NULL, '2021-01-15 08:56:00', 1, 'en', 'Asus ROG Strix 9.Nesil i5 GTX1650 256GB SSD 9AYLIK GARANTİLİ', '<p>SON FİYAT!!\r\nPAZARLIK SÜNNETTİR UFAK Bİ PAZARLIK OLUR ABARTICAKLAR UZAK DURSUN&nbsp;\r\nÜRÜN 31.03.2020 DE HEPSİBURADA DAN ALINMISTIR.1.5SENE CİVARI GARANTISI VAR\r\nTOPLAMDA 12GUN KULLANILMISTIR PROGRAMDA CALISMA SURESİ YAZIYOR\r\nKUTU, FATURA VE GARANTİ MEVCUT OLUP HERŞEY EKSİKSİZDİR.\r\nKOZMATIK 10/10 PERFORMANS 10/10\r\nÖZELLİKLER;\r\ni5 9300H 4.1 GHZ \r\nNVDİA GTX1650 4GB \r\n8GB 2666mHz RAM (32gb a kadar yukseltılebılır )\r\n3D FLOW ZONE FAN TASARIMI ILE USTTEN ALDIGI SOGUK HAVAYI ARKADAN ATAR.\r\nALTTAN AYDINLATMALI ÖZEL RGB TASARIM +ÖZEL NUMPAD TUŞLAR\r\n15.6 IPS YANSIMASIZ LED EKRAN VE ŞIK INCE ÇERÇEVE\r\nÇİFT HAPARLÖR 2X\r\nÇİFT FAN 2X\r\nRGB KLAVYE ÖZEL ROG TUSLARI VE ÖZEL WASD TUŞLARI\r\n250GB M.2 SSD SATA SSD DEN 5-6 KAT HIZLI \r\nBATARYA DURUMU ILK GUNKU GİBİ İYİ\r\n</p>'),
