(50046, 50046, '2021-01-15 09:14:06', NULL, '2021-01-15 09:14:59', 1, 'en', 'MONSTER TULPAR T5 18.1 GAMİNG LAPTOP BİLGİSAYAR TERTEMİZ', '<p>---Monster tulpar T5 18.1 gaming laptop--- * <br></p><p>İntel Coffee Lake Core İ7 8750H  * 6 GB GDDR5 Nvidia GTX1060 192 BİT\r\n * 15.6\" Full HD 1920*1080 144hz IPS MAT LED EKRAN  * 8 GB 1*8 DDR4 2666Mhz 16 ya yükseltilebilir\r\n * 256 GB XPG PRO m2 SSD (3500 MB OKUMA/1200 MB YAZMA)  * 250 gb sandisk ssd\r\n * 3 Adet disk seçeneği ( 1 adet m2 ssd daha takabilirsiniz.)\r\n * Rgb mekanik klavye  * Windows 10 Home lisanslı sürüm 700₺ faturada yazıyor\r\n * Üzerinde çizik değil toz dahi yok 2,3 günde bir tozunu alırım  aldığımdan beri harici monitör klavye mause ve soğutucu ile kullandım  ekranda ölü pixel yok tertemiz 1 ay önce monster servisinde bakımları  yapıldı ömür boyu ücretsiz bakım hizmeti var 1 ay daha garantisi mevcut  hiçbir sorunu sıkıntısı yoktur kutusu faturası tüm belgeleri vardır ssd  veya harddisk takmanız için kullanılan aparat dahi tüm herşey  eksiksizdir İsteyene detaylı görüntü atabilirim şimdiden alıcısına  hayırlı olsun Diğer ilanımda samsung 2k 144 hz 27 inç kcurved monitör  var onada bakabilirsiniz \r\n</p>'),
(50047, 50047, '2021-01-15 09:15:50', NULL, '2021-01-15 09:16:43', 1, 'en', 'Sahibinden Temiz hatasız Hyundai ix35 Benzin LPG', '<p>Aracım garaj arabasıdır temiz bakılmıştır. <br>En Fulludur. <br>Ek olarak beygir yükseltici çip mevcuttur</p>\r\n<p>Son sistem ayriyeten. ekran vardır <br>Garajdan çıkarken sürtmeden dolayı 5.000 tl hasar kaydı vardır oda serviste yapıldığı için onun dışında son sistem dir çalışmayan aksamı yoktur.</p>'),
(50048, 50048, '2021-01-15 09:17:27', NULL, '2021-01-15 09:19:03', 1, 'en', 'SATILIK TAKASLIK IPHONE 12 PRO MAX MAVİ 256 GB SIFIR', '<p>İPHONE 12 PRO MAX PASİFİK MAVİSİ 256&nbsp;GB&nbsp;DAHİLİ HAFIZAYA SAHİPTİR</p>\r\n<p>\r\nÜRÜN FİZİKİ ÇİFT SİM\'Lİ MODELDİR\r\n*CİHAZ SADECE 5 GÜNLÜKTÜR*\r\n</p>\r\n<p>SIFIR ÜRÜNDÜR.\r\n</p>');
